//             <h1>Hello, i am an {match.params.name} page.....</h1>
//         </>
//     );
// };
const User = () => {
    const {fname,lname} = useParams();
    const location = useLocation();
    console.log(location);
    return (
        <>
            <h1>Hello, i am an {fname} {lname} page.....</h1>
            <p>My current location is {location.pathname}</p>
        </>
    );
};
export default User;
